import { useEffect } from "react";
import { get } from "./util/http";

type RawDataBlogPost = {
  userId: number;
  id: number;
  title: string;
  body: string;
};

function App() {
  useEffect(() => {
    async function fetchPosts() {
      const data = (await get(
        "https://jsonplaceholder.typicode.com/posts",
      )) as RawDataBlogPost[];

      for (let i: number = 0; i < data.length; i++) {
        console.log(data[i]);
      }
    }
  }, []);

  return <main></main>;
}

export default App;
